def draw_geo_map(data_map):
    # wkb_data = "0103000020E6100000010000000500000024A82BE9725427404EDCE0FA6609484072BE7DC27E5427401EAE30D868094840C9810D3E835427406C932F0D680948407B6BBB64775427409CC1DF2F6609484024A82BE9725427404EDCE0FA66094840"
    # wkb_data2=''
    # # Convert WKB data to a geometry object
    # wkb_data_list = [
    # wkb_data,wkb_data2,
    #     # "0103000020E6100000010000000500000024A82BE9725427404EDCE0FA6609484072BE7DC27E5427401EAE30D868094840C9810D3E835427406C932F0D680948407B6BBB64775427409CC1DF2F6609484024A82BE9725427404EDCE0FA66094840"
    #     ""
    # ]
    assert isinstance(data_map, dict), "Input must be a dictionary"
    wkb_data_list=list(data_map.values())
    geometry_names=list(data_map.keys())
    # Function to generate a random color
    def random_color():
        return "#" + ''.join([random.choice('0123456789ABCDEF') for j in range(6)])

    # Create a Folium map
    m = folium.Map(location=[0, 0], zoom_start=2)
    # geometry_names = ["Geometry 1", "Geometry 2","Geometry 3"]

    # Loop through each WKB data string and its corresponding name
    for wkb_data, name in zip(wkb_data_list, geometry_names):
        geometry = wkb.loads(bytes.fromhex(wkb_data))
        folium.GeoJson(
            geometry,
            style_function=lambda x, color=random_color(): {'fillColor': color, 'color': color},
            tooltip=name  # Add a tooltip with the name
        ).add_to(m)

    # Save the map to an HTML file

    # Save the map to an HTML file
    map_path = r'C:\Users\Morning\Desktop\hiwi\ttl_query\visualized_geometry_map.html'
    m.save(map_path)

    # Open the HTML file in the default web browser
    webbrowser.open('file://' + map_path)
